import React from 'react';
import { Button, Grid, List, Modal } from 'semantic-ui-react';
import PageTemplate from '../../../common/PageTemplate';

function Meeting({ meeting }) {
  return (
    <List divided relaxed>
      <List.Item>
        <Button>{meeting.MeetingName}</Button>
      </List.Item>
    </List>
  );
}

function MeetingList(props) {
  const [open, setOpen] = React.useState(false);

  const { history } = props;
  const ExampleList = [
    { id: 3, MeetingName: 'You are full of bullshit' },
    { id: 1, MeetingName: 'And you are full of bullsthit' },
    { id: 2, MeetingName: 'Finally you are full of bullshit' },
  ];

  return (
    <div className="MeetingList">
      <PageTemplate>
        <Grid celled>
          <Grid.Row stretched>
            <Grid.Column>
              <Modal
                onClose={() => setOpen(false)}
                onOpen={() => setOpen(true)}
                open={open}
                trigger={<Button>Filter</Button>}
              >
                <Modal.Header>Filter</Modal.Header>
                <Modal.Description>
                  <p>Location</p>
                  <p>Time</p>
                  <p>#Tag</p>
                </Modal.Description>
                <Modal.Actions>
                  <Button onClick={() => setOpen(false)}>Back</Button>
                  <Button
                    content="Confirm"
                    labelPosition="right"
                    icon="checkmark"
                    onClick={() => setOpen(false)}
                    positive
                  />
                </Modal.Actions>
              </Modal>

              {ExampleList.map((meeting) => (
                <Meeting meeting={meeting} key={meeting.id} />
              ))}
              <h1>You are full of bullshit</h1>
            </Grid.Column>
          </Grid.Row>
        </Grid>

        <Button onClick={() => history.push('/main')}>back</Button>
      </PageTemplate>
    </div>
  );
}

export default MeetingList;
